description:
If every soldier of Christ had done his duty, if every watchman on the walls of Zion had given the trumpet a certain sound, the world might ere this have heard the message of warning. But the work is years behind. While men have slept, Satan has stolen a march upon us. {9T 29.2}
 Much of the prejudice that prevents the truth of the third angel's message from reaching the hearts of the people, might be removed if more attention were given to health reform. When people become interested in this subject, the way is often prepared for the entrance of other truths. If they see that we are intelligent with regard to health, they will be more ready to believe that we are sound in Bible doctrines. {CD 76.5}  
I wish to tell you that soon there will be no work done in ministerial lines but medical missionary work. {CH 533.1}
